import React from "react";

export default function Navbar() {
  return (
    <header>
        <div>
      <i className="fa-brands fa-reddit"></i>
      <div>
        <button>Log In</button>
        <i class="fa-regular fa-user"></i>
      </div>
      </div>
    </header>
  );
}
